(22, 1, '2020-07-31 17:01:21', '2020-07-31 20:01:21', '<!-- wp:paragraph -->\n<p>Home  »  Benefícios exclusivos para assinantes</p>\n<!-- /wp:paragraph -->		\n				<h3>\n					Benefícios exclusivos para assinantes\n				</h3>\n				<h3>\n					SOBRE OS BENEFÍCIOS\n				</h3>\n		<p>Todos os benefícios oferecidos foram obtidos em parceria com empresas que acreditamos que estão conectadas com os <a href=\"#\">nossos valores Suno</a>.</p>\n<p>Nosso propósito é conectar empresas e assinantes Suno, de forma a auxiliar as empresas e nossos assinantes a alcançarem maior bem-estar, qualidade e desenvolvimento pessoal e financeiro.</p>\n<p>Caso queira indicar uma empresa, acesse o link <a href=\"#\">indique uma empresa</a>.</p>		\n			<h3>Categorias</h3>', 'Home', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2020-07-31 17:01:21', '2020-07-31 20:01:21', '', 5, 'http://localhost/wordpress_desafio_suno_anderson_michel/5-revision-v1/', 0, 'revision', '', 0),
